+ (void)drawSuspensionPullmanWithVisibleSuspension: (BOOL)visibleSuspension
{
    //// General Declarations
    CGContextRef context = UIGraphicsGetCurrentContext();

    if (visibleSuspension)
    {
        //// suspension Drawing
        CGRect suspensionRect = CGRectMake(0, 0, 90, 26);
        CGContextSaveGState(context);
        UIRectClip(suspensionRect);
        CGContextTranslateCTM(context, suspensionRect.origin.x, suspensionRect.origin.y);
        CGContextScaleCTM(context, suspensionRect.size.width / 74, suspensionRect.size.height / 21);

        [VanStyleKit drawSuspensionLogo];
        CGContextRestoreGState(context);
    }
}

