+ (void)drawAppIcon
{
    //// General Declarations
    CGColorSpaceRef colorSpace = CGColorSpaceCreateDeviceRGB();
    CGContextRef context = UIGraphicsGetCurrentContext();

    //// Color Declarations
    CGFloat vermellEquusHSBA[4];
    [VanStyleKit.vermellEquus getHue: &vermellEquusHSBA[0] saturation: &vermellEquusHSBA[1] brightness: &vermellEquusHSBA[2] alpha: &vermellEquusHSBA[3]];

    UIColor* color7 = [UIColor colorWithHue: vermellEquusHSBA[0] saturation: vermellEquusHSBA[1] brightness: 0.8 alpha: vermellEquusHSBA[3]];

    //// Gradient Declarations
    CGFloat gradientAppIconLocations[] = {0, 0.35, 1};
    CGGradientRef gradientAppIcon = CGGradientCreateWithColors(colorSpace, (__bridge CFArrayRef)@[(id)color7.CGColor, (id)[color7 blendedColorWithFraction: 0.5 ofColor: VanStyleKit.vermellEquus].CGColor, (id)VanStyleKit.vermellEquus.CGColor], gradientAppIconLocations);

    //// Rectangle Drawing
    CGContextSaveGState(context);
    CGContextScaleCTM(context, 17, 17);

    UIBezierPath* rectanglePath = [UIBezierPath bezierPathWithRect: CGRectMake(0, 0, 60.24, 60.24)];
    CGContextSaveGState(context);
    [rectanglePath addClip];
    CGContextDrawLinearGradient(context, gradientAppIcon, CGPointMake(30.12, 60.24), CGPointMake(30.12, -0), 0);
    CGContextRestoreGState(context);

    CGContextRestoreGState(context);


    //// Symbol Drawing
    CGContextSaveGState(context);
    CGContextTranslateCTM(context, 113, 247);
    CGContextScaleCTM(context, 17, 17);

    CGRect symbolRect = CGRectMake(0, 0, 53, 35.06);
    CGContextSaveGState(context);
    UIRectClip(symbolRect);
    CGContextTranslateCTM(context, symbolRect.origin.x, symbolRect.origin.y);
    CGContextScaleCTM(context, symbolRect.size.width / 126, symbolRect.size.height / 80);

    [VanStyleKit drawTrailerWithColorParameter: VanStyleKit.blancCavall scale: 1 alpha: 1];
    CGContextRestoreGState(context);

    CGContextRestoreGState(context);


    //// Cleanup
    CGGradientRelease(gradientAppIcon);
    CGColorSpaceRelease(colorSpace);
}

